import React from 'react';

function ExperienceIndi(props) {
  return (
    <div className="experience-indi">
      <div className="left">
        <img
          className="logo"
          src={props.logo}
          alt={props.company + ' logo'}
          height="100"
          width="100"
        />
        <div className="text">
          <h3 className="company">{props.company}</h3>
          <h4 className="location"> {props.location}</h4>
          <h4 className="date"> {props.date}</h4>
        </div>
      </div>
      <div className="right">
        <h3 className="title">{props.role}</h3>
        <p className="description">{props.description}</p>
      </div>
      <hr />
    </div>
  );
}

export default ExperienceIndi;
